`;

const Item = styled.button`
    background-color: none;
    border: none;
`;

const NavegacionMenu = () => {
    return (
        <div className="py-5 mx-auto text-center">
            <Nav>
                <Item>Comidas</Item>
                <Item>Vinos</Item>
                <Item>Cocteler√≠a</Item>
                <Item>Bebidas</Item>
            </Nav>
        </div>
    );
}
 
export default NavegacionMenu;
